import React, { Component } from 'react';
import logo from './logo.svg';
import Lista from './Lista';


class App extends Component {

  render() {

    return (


      <div className="container">  
        <div className="row">
          <div className="col-md-6 mx-auto">
              <h1 className="text-center">MVC Todo</h1>
                      <Lista />                   
          </div>
        </div>
      </div>

    )     
  }
}

export default App;
